var w = $("#"+id);

// constants
var BOARD_WIDTH = 20;
var BOARD_HEIGHT = 20;
var PIECE_SIZE = 20;

var x_pos = 10;
var y_pos = 10;
var x_dir = 1, y_dir = 0;
var tail = Array();
game_over = false;


jwerty.key('↑', function() { console.log('up'); x_dir = 0; y_dir = -1 });
jwerty.key('↓', function() { x_dir = 0; y_dir = 1; });
jwerty.key('←', function() { x_dir = -1; y_dir = 0; });
jwerty.key('→', function() { x_dir = 1; y_dir = 0 });


function game_over_f() {
    alert ('BOOM!');
    w.trigger('game_over');
    game_over = true;
}


function draw() {
    // update position
    x_pos += x_dir;
    y_pos += y_dir;

    // check for collission
    if (x_pos < 0 || x_pos >= BOARD_WIDTH || y_pos < 0 || y_pos >= BOARD_HEIGHT) {
        game_over_f();
    }

    for (var i=0;i<tail.length;i++) {
        if (x_pos == tail[i].x && y_pos == tail[i].y) {
            game_over_f();
        }
    }

    // add to tail
    tail.unshift({ x: x_pos, y: y_pos });

    // redraw
    w.css('left', x_pos * 20 + 'px');
    w.css('top', y_pos * 20 + 'px');

    // check for food
    var food_x = $('.food').data('x');
    var food_y = $('.food').data('y');

    if (food_x == x_pos && food_y == y_pos) {
        w.trigger('piece_eaten');
        console.log('HIT!');
    } else {
        // remove tail piece
        tail.splice(-1);
    }

    // tail
    $(document).find('.tail_piece').remove();
    for (var i=0;i<tail.length;i++) {
        w.closest('.board').append(widget('s:tail_piece', { x: tail[i].x, y: tail[i].y }));
    }


    console.log(tail.length);

    if (!game_over) {
        setTimeout(draw, 200);
    }
}

draw();

