game_over = false;


function reverse() {
    console.log('reverse!');

    tail.reverse();

	// direction
    if (tail.length > 2) {
        x_dir = tail[0].x - tail[1].x;
        y_dir = tail[0].y - tail[1].y;
    } else {
        x_dir = x_dir * -1;
        y_dir = y_dir * -1;
    }


    x_pos = tail[0].x;
    y_pos = tail[0].y;
}


