    // update position
    x_pos += x_dir;
    y_pos += y_dir;

    // check for collission
    // wall
    if (x_pos < 0 || x_pos >= config.BOARD_WIDTH || y_pos < 0 || y_pos >= config.BOARD_HEIGHT) {
        game_over_f();
        return;
    }
	// self
    for (var i=0;i<tail.length;i++) {
        if (x_pos == tail[i].x && y_pos == tail[i].y) {
            game_over_f();
            return;
        }
    }

    // add to tail
    tail.unshift({ x: x_pos, y: y_pos });

    // redraw
    w.css('left', x_pos * config.PIECE_SIZE + 'px');
    w.css('top', y_pos * config.PIECE_SIZE + 'px');

    // check for food
    var food_x = $('.food').data('x');
    var food_y = $('.food').data('y');

    if (food_x == x_pos && food_y == y_pos) {
        w.trigger('piece_eaten', { tail: tail } );
    } else {
        // remove tail piece
        tail.splice(-1);
    }

    // tail
    var tail_of_tail_x = tail[tail.length-1].x;
    var tail_of_tail_y = tail[tail.length-1].y;

    console.log('tail of tail: ', tail_of_tail_y, tail_of_tail_x);

    /*
    w.closest('.board')
