            x: tail[0].x,
            y: tail[0].y,
            config: config 
        }));

    $('.tail_piece[data-xpos='+tail_of_tail_x+'][data-ypos='+tail_of_tail_y+']').remove();
    */

    $(document).find('.tail_piece').remove();
    for (var i=1;i<tail.length;i++) {
        w.closest('.board').append(widget('s:tail_piece', { x: tail[i].x, y: tail[i].y, config: config }));
    }
    // */

    if (!game_over) {
        setTimeout(draw, config.SPEED);
    }
}


