function reverse() {
    console.log('reverse!');

    tail.reverse();

	// direction
    if (tail.length > 2) {
        x_dir = tail[0].x - tail[1].x;
        y_dir = tail[0].y - tail[1].y;
    } else {
        x_dir = x_dir * -1;
        y_dir = y_dir * -1;
    }


    x_pos = tail[0].x;
    y_pos = tail[0].y;
}


function draw() {
    // update position
    x_pos += x_dir;
    y_pos += y_dir;

    // check for collission
    // wall
    if (x_pos < 0 || x_pos >= config.BOARD_WIDTH || y_pos < 0 || y_pos >= config.BOARD_HEIGHT) {
        game_over_f();
        return;
    }
	// self
    for (var i=0;i<tail.length;i++) {
        if (x_pos == tail[i].x && y_pos == tail[i].y) {
            game_over_f();
            return;
        }
    }

    // add to tail
    tail.unshift({ x: x_pos, y: y_pos });

    // redraw
    w.css('left', x_pos * config.PIECE_SIZE + 'px');
    w.css('top', y_pos * config.PIECE_SIZE + 'px');

    // check for food
    var food_x = $('.food').data('x');
    var food_y = $('.food').data('y');

    if (food_x == x_pos && food_y == y_pos) {
        w.trigger('piece_eaten', { tail: tail } );
    } else {
        // remove tail piece
        tail.splice(-1);
    }

    // tail
    var tail_of_tail_x = tail[tail.length-1].x;
    var tail_of_tail_y = tail[tail.length-1].y;

    console.log('tail of tail: ', tail_of_tail_y, tail_of_tail_x);

    /*
    w.closest('.board')
    	.append(widget('s:tail_piece', {
            x: tail[0].x,
            y: tail[0].y,
            config: config 
        }));

    $('.tail_piece[data-xpos='+tail_of_tail_x+'][data-ypos='+tail_of_tail_y+']').remove();
    */

    $(document).find('.tail_piece').remove();
    for (var i=1;i<tail.length;i++) {
        w.closest('.board').append(widget('s:tail_piece', { x: tail[i].x, y: tail[i].y, config: config }));
    }
    // */

    if (!game_over) {
        setTimeout(draw, config.SPEED);
    }
}


function game_over_f() {
    w.trigger('game_over');
    game_over = true;
}


jwerty.key('↑', function() { x_dir = 0; y_dir = -1 });
jwerty.key('↓', function() { x_dir = 0; y_dir = 1; });
jwerty.key('←', function() { x_dir = -1; y_dir = 0; });
jwerty.key('→', function() { x_dir = 1; y_dir = 0 });
jwerty.key('r', reverse);

draw();

