w.bind('game_over', function() {
    w.append(widget('s:game_over'));
});

var w = $("#"+id);

// setup
w.css('width', config.PIECE_SIZE + 'px');
w.css('height', config.PIECE_SIZE + 'px');

var x, y;

function draw (e, tail) {
    var tail_collission = false;

    do {
        x = Math.floor(Math.random() * config.BOARD_WIDTH);
        y = Math.floor(Math.random() * config.BOARD_HEIGHT);

        for (var i=0;i<tail.length;i++) {
            if (x == tail[i].x && y == tail[i].y)
                tail_collision = true;
        }
    } while (tail_collission == true);

    w.css('left', x * config.PIECE_SIZE + 'px');
    w.css('top', y * config.PIECE_SIZE + 'px');

    w.data('x',x);
    w.data('y',y);
}

w.closest('.game').bind('piece_eaten', draw);
draw(null, Array());

